function BrandCarousel() {
  const itemWidth = 260
  const totalWidth = brands.length * itemWidth;

  return (
    <section className="py-12 bg-gray-50 px-[2.5vw] relative group overflow-hidden">
      <div className="relative">
        <motion.div
          className="flex whitespace-nowrap"
          animate={{
            x: [0, -totalWidth],
          }}
          transition={{
            ease: "linear",
            duration: 15,
            repeat: Infinity,
            repeatType: "loop",
          }}
          style={{ width: totalWidth * 2 }}
        >
          {[...brands, ...brands].map((Brand, index) => (
            <div
              key={index}
              className="flex shrink-0 justify-center items-center "
              style={{ width: itemWidth }}
            >
              {React.cloneElement(Brand, {
                height: 16,
                className:
                  "opacity-80 hover:opacity-100 transition-all duration-300  [&_path]:fill-black [&_path]:hover:fill-[#A3E635] [&_rect]:fill-white [&_rect]:hover:fill-[#A3E635]",
              })}
            </div>
          ))}
        </motion.div>
      </div>
      <div className="absolute inset-y-0 left-0 w-32 bg-gradient-to-r from-gray-50 to-transparent z-10 pointer-events-none" />
      <div className="absolute inset-y-0 right-0 w-32 bg-gradient-to-l from-gray-50 to-transparent z-10 pointer-events-none" />
    </section>
  );
}

export default BrandCarousel;